import React from 'react';
import { FontAwesomeIcon } from '@fortawesome/react-fontawesome';
import { faRocket } from '@fortawesome/free-solid-svg-icons';
import styled from 'styled-components';



const NasaCard = (props)=>{

    const NasaCardContainer = styled.div`
    display: flex;
    flex-direction: column;
    align-items: center;
    `;

    const Title = styled.h2`
    font-family: 'Libre Baskerville', serif;
    color: #0f4040;
    font-size: 3rem;
    text-shadow: 2px 2px #0A0D42;
    text-align: center;
    `;

    const Date = styled.h2`
    font-family: 'Courgette', cursive;
    font-size: 2rem;
    color: #989BC1;
    text-shadow: 1px 1px #0A0D42;
    `;

    const Img = styled.img`
    width: 75%;
    `;

    const Description = styled.p`
    line-height: 1.6;
    font-family: 'Montserrat', sans-serif;
    margin-top: 8%;
    `;

    return (
        // <NasaCardContainer>
        <div id="nasaCardContainer">

            {/* <Title> */}
            <div id="title">
                <FontAwesomeIcon icon={faRocket} />{props.title}<FontAwesomeIcon icon={faRocket} />
            </div>
            {/* </Title> */}
            <Date>{props.date}</Date>
            <Img src={props.url}/>
            <Description>{props.explanation}</Description>
        </div>
        // </NasaCardContainer>
    )
}

export default NasaCard;
